import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

ReactDOM.render(<App title = "HappyCode" />, document.getElementById('root'));
phrase="la cosmogonie des grecs anciens débute avec chaos";
